    std::vector<integer> integer::INNER_init_known_prime()
    {
        auto const TEMP_known_prime = integer::INNER_get_known_prime();

        std::vector<integer> result;
        result.resize(TEMP_known_prime.size());
        for (std::size_t i = 0;i < result.size();i++)
        {
            result[i] = integer(TEMP_known_prime[i], sign_type::positive);
        }

        return result;
    }

    void integer::operator +=(integer const & right)
    {
        (*this) = (*this) + right;
    }
    void integer::operator ++()
    {
        (*this) += integer(1, sign_type::positive);
    }
    void integer::operator -=(integer const & right)
    {
        (*this) = (*this) - right;
    }
    void integer::operator --()
    {
        (*this) -= integer(1, sign_type::positive);
    }
    void integer::operator *=(integer const & right)
    {
        (*this) = (*this) * right;
    }
    void integer::operator /=(integer const & right)
    {
        (*this) = (*this) / right;
    }
    void integer::operator %=(integer const & right)
    {
        (*this) = (*this) % right;
    }
